import React from "react";
import TheLoop from '../partials/TheLoop';
import {Provider} from '../context/Context';

const Home = (props) => {
    return (
        <Provider router={props}>
        <div>
            <h1>Home</h1>
            <TheLoop></TheLoop>
        </div>
        </Provider>
    );
}

export default Home;
